import React from 'react';

function SearchResult({ results }) {
    return (
        <div>
            <h2>Search Results:</h2>
            <ul>
                {results.map((result, index) => (
                    <li key={index}>{result.content}</li>
                ))}
            </ul>
        </div>
    );
}

export default SearchResult;
